[{"location":"grafodipendenze/#Grafo-delle-Dipendenze","page":"Grafo delle Dipendenze","title":"Grafo delle Dipendenze","text":"","category":"section"},{"location":"grafodipendenze/","page":"Grafo delle Dipendenze","title":"Grafo delle Dipendenze","text":"In questa sezione è rappresentato il grafo orientato delle dipendenze della base di codice oggetto di studio. Ogni arco orientato rappresenta una chiamata di funzione (v_1 v_2), dove v_1 è la funzione chiamante, e v_2 è la funzione chiamata. I nodi hanno un’etichetta corrispondente al nome della funzione. Gli archi invece hanno una etichetta numerica consecutiva corrispondente all’ordine delle chiamate dal nodo loro origine.","category":"page"},{"location":"grafodipendenze/","page":"Grafo delle Dipendenze","title":"Grafo delle Dipendenze","text":"image image image image image image image","category":"page"},{"location":"conclusioni/#Conclusioni","page":"Conclusione","title":"Conclusioni","text":"","category":"section"},{"location":"conclusioni/","page":"Conclusione","title":"Conclusione","text":"Nonostante le modifiche apportate all'algoritmo sostengano maggiormente le prestazioni riducendo il tempo di esecuzione, sviluppi futuri possono prevedere l'impiego di tecnologie come:","category":"page"},{"location":"conclusioni/","page":"Conclusione","title":"Conclusione","text":"'Distributed Workers' - In questo modo i processi Julia verrebbero eseguiti con spazi di memoria separati, garantendo prestazioni ancora maggiori.","category":"page"},{"location":"conclusioni/","page":"Conclusione","title":"Conclusione","text":"'Asynchronous Tasks' - Consentono di sospendere e riprendere i calcoli per I/O e gestione di eventi. I Tasks possono sincronizzarsi tramite la comunicazione per mezzo dei canali.","category":"page"},{"location":"#TGW2D","page":"Informazioni Generali","title":"TGW2D","text":"","category":"section"},{"location":"","page":"Informazioni Generali","title":"Informazioni Generali","text":"Progetto Topological Gift Wrapping 2D per Calcolo Parallelo e Distribuito sviluppato da:","category":"page"},{"location":"","page":"Informazioni Generali","title":"Informazioni Generali","text":"Nome Matricola E-mail Github Profile\nMatteo Maraziti 534932 mat.maraziti@stud.uniroma3.it https://github.com/matteomaraziti\nFederico Tocci 533449 fed.tocci@stud.uniroma3.it https://github.com/FTocci\nGiacomo Scordino 533393 gia.scordino1@stud.uniroma3.it https://github.com/GiacomoScordino","category":"page"},{"location":"","page":"Informazioni Generali","title":"Informazioni Generali","text":"Documentazione: https://ftocci.github.io/TGW2D/build/  ","category":"page"},{"location":"","page":"Informazioni Generali","title":"Informazioni Generali","text":"Repository: https://github.com/FTocci/TGW2D","category":"page"},{"location":"","page":"Informazioni Generali","title":"Informazioni Generali","text":"Notebooks:","category":"page"},{"location":"","page":"Informazioni Generali","title":"Informazioni Generali","text":"Studio Preliminare: https://github.com/FTocci/TGW2D/blob/main/notebooks/NotebookPreliminare.ipynb\nStudio Esecutivo - Finale: https://github.com/FTocci/TGW2D/blob/main/notebooks/NotebookFinale.ipynb","category":"page"},{"location":"#Rapid-Explanation-(for-English-Users)","page":"Informazioni Generali","title":"Rapid Explanation (for English Users)","text":"","category":"section"},{"location":"","page":"Informazioni Generali","title":"Informazioni Generali","text":"The Topological Gift Wrapping repository contains functions for computing the arrangement on the given cellular complex 1-skeleton in 2D. A cellular complex is arranged when the intersection of every possible pair of cell of the complex is empty and the union of all the cells is the whole Euclidean space. The basic method of the function without the sigma, return_edge_map and multiproc arguments returns the full arranged complex V, EV and FE.","category":"page"}]
